import React from 'react';
import axios from 'axios';
import { NavLink, useNavigate } from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate();

    const logout = async (e) => {
        e.preventDefault();
        // const token = localStorage.getItem('token');
        try {
            const response = await axios.post('https://login-api.web2rise.in/api/logout');

            if (response) {
                localStorage.removeItem('token');
                navigate('/');
            }
        } catch (error) {
            console.error(error);
        }
    };

    return (
        <>
            {/* <div className='main_div'>
                <ul className='child_div'>
                    <NavLink className='create_user' to="/CreateUser">
                        <li className='create_user1'>Create User</li>
                    </NavLink>
                    <NavLink className='create_user' to="/User">
                        <li className='create_user2'>User</li>
                    </NavLink>
                    <li onClick={logout} className='create_user'>
                        Logout
                    </li>
                </ul>
            </div> */}

            {/* <aside>
                <nav>
                    <ul>
                        <NavLink to="/CreateUser"><li>Create User</li></NavLink>
                        <NavLink to="/User"><li>User</li></NavLink>
                        <li onClick={logout}>Logout</li>
                    </ul>
                </nav>
            </aside> */}

            <nav class="navbar navbar-expand-lg navbar-light bg-light">
                <div class="container-fluid">
                    <a class="navbar-brand" href="#">Navbar</a>
                    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                    <div class="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                            <li class="nav-item">
                                <a class="nav-link active" aria-current="page" href="#">Home</a>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
        </>
    );
};

export default Home;
